        public static void draw_point(d5 point, PictureBox p, Graphics g)
        {
            point.x = point.X * E1[0] + point.Y * E2[0] + point.Z * E3[0] + point.T * E4[0] + point.U * E5[0];
            point.y = point.X * E1[1] + point.Y * E2[1] + point.Z * E3[1] + point.T * E4[1] + point.U * E5[1];
            g.FillEllipse(Brushes.Black, (float)point.x + p.Width / 2, (float)point.y + p.Height / 2, 2, 2);
        }
        public static void draw_line(d5 point1, d5 point2, PictureBox p, Graphics g)
        {
            point1.x = point1.X * E1[0] + point1.Y * E2[0] + point1.Z * E3[0] + point1.T * E4[0] + point1.U * E5[0];
            point1.y = point1.X * E1[1] + point1.Y * E2[1] + point1.Z * E3[1] + point1.T * E4[1] + point1.U * E5[1];
            point2.x = point2.X * E1[0] + point2.Y * E2[0] + point2.Z * E3[0] + point2.T * E4[0] + point2.U * E5[0];
            point2.y = point2.X * E1[1] + point2.Y * E2[1] + point2.Z * E3[1] + point2.T * E4[1] + point2.U * E5[1];
            g.DrawLine(Pens.Black, (float)point1.x + p.Width / 2, (float)point1.y + p.Height / 2, (float)point2.x + p.Width / 2, (float)point2.y + p.Height / 2);
        }
        static void draw_line_color(d5 point1, d5 point2, PictureBox p, Graphics g, Color col)
        {
            Pen pn = new Pen(col);
            g.DrawLine(pn, (float)point1.X + p.Width / 2, (float)point1.Y + p.Height / 2, (float)point2.X + p.Width / 2, (float)point2.Y + p.Height / 2);
        }
        public static void draw_basis(PictureBox p, Graphics g)
        {
            d5 x = new d5(100 * E1[0], 100 * E1[1], 100 * E1[2], 100 * E1[3], 100 * E1[4]);
            d5 y = new d5(100 * E2[0], 100 * E2[1], 100 * E2[2], 100 * E2[3], 100 * E2[4]);
            d5 z = new d5(100 * E3[0], 100 * E3[1], 100 * E3[2], 100 * E3[3], 100 * E3[4]);
            d5 t = new d5(100 * E4[0], 100 * E4[1], 100 * E4[2], 100 * E4[3], 100 * E4[4]);
            d5 u = new d5(100 * E5[0], 100 * E5[1], 100 * E5[2], 100 * E5[3], 100 * E5[4]);
            d5 zero = new d5(0, 0, 0, 0, 0);
            draw_line_color(zero, x, p, g, Color.Red);
            draw_line_color(zero, y, p, g, Color.Green);
            draw_line_color(zero, z, p, g, Color.Blue);
            draw_line_color(zero, t, p, g, Color.Gold);
            draw_line_color(zero, u, p, g, Color.Pink);
        }
